channel.postprocessingScript:
var responseD1 = responseMap.get('d1')

if (responseD1.getStatus() == "SENT") {

	return responseD1;
}

else if (responseD1.getStatus() == "QUEUED") {

	varCustomACK = ACKGenerator.generateAckResponse(message.getConnectorMessages().get(0).getRawData(), "AA", "Message queued on destination");

	return ResponseFactory.getSentResponse('customACK')
}

else{
	var customACK = ACKGenerator.generateAckResponse(message.getConnectorMessages().get(0).getRawData(), "AE", "An error occurred during processing");
	return ResponseFactory.getErrorResponse('customACK')


}

